        is_precision_better_than_bias_in_perecent_for_specific_lambda.percentage_direct_values(is_precision_better_than_bias_in_perecent_for_specific_lambda.SNR==52 & is_precision_better_than_bias_in_perecent_for_specific_lambda.dki_model == "DKIax-NLLS" & is_precision_better_than_bias_in_perecent_for_specific_lambda.AxTM == string(AxTM_names{inx_AxTM})& is_precision_better_than_bias_in_perecent_for_specific_lambda.protocol == string(simulation_parameters.measurement_protocol{inx_protocol})), ...
        is_precision_better_than_bias_in_perecent_for_specific_lambda.percentage_direct_values(is_precision_better_than_bias_in_perecent_for_specific_lambda.SNR==30 & is_precision_better_than_bias_in_perecent_for_specific_lambda.dki_model == "DKIax-NLLS" & is_precision_better_than_bias_in_perecent_for_specific_lambda.AxTM == string(AxTM_names{inx_AxTM})& is_precision_better_than_bias_in_perecent_for_specific_lambda.protocol == string(simulation_parameters.measurement_protocol{inx_protocol})), ...
        is_precision_better_than_bias_in_perecent_for_specific_lambda.percentage_direct_values(is_precision_better_than_bias_in_perecent_for_specific_lambda.SNR==15 & is_precision_better_than_bias_in_perecent_for_specific_lambda.dki_model == "DKIax-NLLS" & is_precision_better_than_bias_in_perecent_for_specific_lambda.AxTM == string(AxTM_names{inx_AxTM})& is_precision_better_than_bias_in_perecent_for_specific_lambda.protocol == string(simulation_parameters.measurement_protocol{inx_protocol})), ...
